        const letra = m.artista.charAt(0).toUpperCase();
        if (!porLetra[letra]) porLetra[letra] = [];
        porLetra[letra].push(m);
      });

      container.innerHTML = '';

      Object.keys(porLetra).sort().forEach(letra => {
        const grupo = document.createElement('div');
        grupo.classList.add('letra-grupo');

        const titulo = document.createElement('div');
        titulo.classList.add('letra-titulo');
        titulo.textContent = `Letra ${letra}`;
        grupo.appendChild(titulo);

        porLetra[letra].forEach(m => {
          const card = document.createElement('div');
          card.classList.add('card');

          card.innerHTML = `
            <div>
              <div><strong>${m.artista}</strong></div>
              <div>${m.musica}</div>
            </div>
            <div class="codigo">${m.codigo}</div>
          `;

          grupo.appendChild(card);
        });

        container.appendChild(grupo);
      });
    }

    input.addEventListener('input', () => atualizarLista(input.value));

    atualizarLista(); // Inicial
  </script>

</body>
</html>
